import React, { useState } from 'react'

const allBrands = [
  { id: 1, brand: 'nike' },
  { id: 2, brand: 'puma' },
  { id: 3, brand: 'addida' },
  { id: 4, brand: 'fila' },
  { id: 5, brand: 'jockey' },
]

function AddToCart() {
  const [selectedBrand, setSelectedBrand] = useState([])

  return (
    <>
      <br /> <br /> <br />
      <ul>
        {allBrands.map((b) => (
          <li key={b.id}>{b.brand}</li>
        ))}
      </ul>
    </>
  )
}

export default AddToCart
